const SHEET_NODE_NAME = "Get row(s) in sheet";

const COLS = {
  CARD_M: "ŸÜŸäÿ™ÿ±Ÿà ŸÇŸäŸÖŸÜŸÇ ÿ®ÿ∑ÿßŸÇÿ© ÿ¥Ÿáÿ±",
  CARD_M_REMAIN: "ÿßŸÑÿ≠ÿØ ÿßŸÑŸÖÿ™ÿ®ŸÇŸä ÿ¥Ÿáÿ±",
  CARD_Y: "ŸÜŸäÿ™ÿ±Ÿà ŸÇŸäŸÖŸÜŸÇ ÿ®ÿ∑ÿßŸÇÿ© ÿ≥ŸÜÿ©",
  CARD_Y_REMAIN: "ÿßŸÑÿ≠ÿØ ÿßŸÑŸÖÿ™ÿ®ŸÇŸä ÿ≥ŸÜÿ©",

  GIFT_M: "ŸÜŸäÿ™ÿ±Ÿà ŸÇŸäŸÖŸÜŸÇ ŸÇŸäŸÅÿ™ ÿ¥Ÿáÿ±",
  GIFT_M_HOURS: "ÿπÿØÿØ ÿßŸÑÿ≥ÿßÿπÿßÿ™ ÿ¥Ÿáÿ±",
  GIFT_M_LEFT: "ÿßŸÑÿ≥ÿßÿπÿßÿ™ ÿßŸÑŸÖÿ™ÿ®ŸÇŸäÿ© ÿ¥Ÿáÿ±",
  GIFT_M_STATUS: "ÿ≠ÿßŸÑÿ© ÿßŸÑÿ±ÿßÿ®ÿ∑ ÿ¥Ÿáÿ±",
  GIFT_M_NUM: "ÿ±ŸÇŸÖ ŸÜŸäÿ™ÿ±Ÿà ÿ¥Ÿáÿ±",

  GIFT_Y: "ŸÜŸäÿ™ÿ±Ÿà ŸÇŸäŸÖŸÜŸÇ ŸÇŸäŸÅÿ™ ÿ≥ŸÜÿ©",
  GIFT_Y_HOURS: "ÿπÿØÿØ ÿßŸÑÿ≥ÿßÿπÿßÿ™ ÿ≥ŸÜÿ©",
  GIFT_Y_LEFT: "ÿßŸÑÿ≥ÿßÿπÿßÿ™ ÿßŸÑŸÖÿ™ÿ®ŸÇŸäÿ© ÿ≥ŸÜÿ©",
  GIFT_Y_STATUS: "ÿ≠ÿßŸÑÿ© ÿßŸÑÿ±ÿßÿ®ÿ∑ ÿ≥ŸÜÿ©",
  GIFT_Y_NUM: "ÿ±ŸÇŸÖ ŸÜŸäÿ™ÿ±Ÿà ÿ≥ŸÜÿ©",

  PROMO: "ŸÜŸäÿ™ÿ±Ÿà ŸÇŸäŸÖŸÜŸÇ ŸÇŸäŸÅÿ™ 3 ÿßÿ¥Ÿáÿ±",
  PROMO_STATUS: "ÿ≠ÿßŸÑÿ© ÿßŸÑÿ±ÿßÿ®ÿ∑ ÿ®ÿ±ŸàŸÖŸà",
  PROMO_EXP: "ÿ™ÿßÿ±ŸäÿÆ ÿßŸÑÿßŸÜÿ™Ÿáÿßÿ°",
  PROMO_NUM: "ÿ±ŸÇŸÖ ŸÜŸäÿ™ÿ±Ÿà 3 ÿßÿ¥Ÿáÿ±",
};

// ÿ£ÿØŸàÿßÿ™ ŸÖÿ≥ÿßÿπÿØÿ©
function n(v,d=0){const x=Number(String(v??"").replace(/[^\d.-]/g,""));return Number.isFinite(x)?x:d;}
function norm(s){return String(s??"").trim().toLowerCase();}
function isAvail(val){
  const s=norm(val);
  if(!s) return false;
  if(s.includes("ŸÖÿ™ŸàŸÅÿ±")||s.includes("ŸÖÿ™ÿßÿ≠")||s.includes("available")||s==="ok"||s==="true"||s==="yes") return true;
  if(s.includes("ŸÖŸÜÿ™ŸáŸä")||s.includes("ÿßŸÜÿ™ŸáŸâ")||s.includes("expired")||s.includes("ÿ∫Ÿäÿ± ŸÖÿ™ÿßÿ≠")||s.includes("not available")||s==="false"||s==="no") return false;
  return false;
}

// ŸáŸÑ ÿßŸÑÿßÿ≥ŸÖ ŸäÿÆÿµ ŸÖŸÜÿ™ÿ¨ÿßÿ™ ÿßŸÑŸÜŸäÿ™ÿ±Ÿà ŸÅŸÇÿ∑
function isNitroName(name){
  const s=norm(name);
  return s.includes("ŸÜŸäÿ™ÿ±Ÿà") || s.includes("nitro");
}

// ÿßÿ≥ÿ™ÿÆÿ±ÿßÿ¨ ÿßŸÑŸÜŸàÿπ/ÿßŸÑŸÅÿ¶ÿ© ŸÖŸÜ ÿßÿ≥ŸÖ ÿßŸÑŸÖŸÜÿ™ÿ¨ ŸÜŸÅÿ≥Ÿá
function parseProductFromName(name){
  const s=norm(name);
  if(!isNitroName(s)) return {productType:null, productCategory:null};

  // ŸÜŸàÿπ ÿßŸÑŸÖŸÜÿ™ÿ¨
  let productType=null;
  if(s.includes("ÿ®ÿ±ŸàŸÖŸà")||s.includes("promo")||s.includes("3 ÿßÿ¥Ÿáÿ±")||s.includes("ÿ´ŸÑÿßÿ´")) productType="promo";
  else if(s.includes("ŸÇŸäŸÅÿ™")||s.includes("gift")) productType="gift";
  else if(s.includes("ÿ®ÿ∑ÿßŸÇÿ©")||s.includes("card")) productType="card";

  // ŸÅÿ¶ÿ© ÿßŸÑŸÖÿØÿ©
  let productCategory=null;
  if(s.includes("ÿ≥ŸÜÿ©")||s.includes("year")) productCategory="year";
  else if(s.includes("ÿ¥Ÿáÿ±")||s.includes("month")) productCategory="month";
  else if(productType==="promo") productCategory=null; // ÿ®ÿ±ŸàŸÖŸà ÿ´ÿßÿ®ÿ™ 3 ÿ£ÿ¥Ÿáÿ±

  return {productType, productCategory};
}

// ŸÑÿ™ÿ≠ÿØŸäÿØ ŸáŸÑ ÿßŸÑÿßÿ≥ŸÖ ŸÅŸäŸá ÿ™ŸÑŸÖŸäÿ≠ ŸÖÿØÿ©/ŸÅÿ¶ÿ©
function nameHasCategory(name){
  const s=norm(name);
  return (
    s.includes("ÿ¥Ÿáÿ±") ||
    s.includes("ÿ≥ŸÜÿ©") ||
    s.includes("month") ||
    s.includes("year") ||
    s.includes("3 ÿßÿ¥Ÿáÿ±") ||
    s.includes("ÿ´ŸÑÿßÿ´") ||
    s.includes("trial") ||
    s.includes("ÿ™ÿ¨ÿ±ÿ®") ||
    s.includes("ÿ™ÿ±ÿßŸäŸÑ") ||
    s.includes("promo") ||
    s.includes("ÿ®ÿ±ŸàŸÖŸà")
  );
}

// ÿ™ÿ¨ŸÖŸäÿπ ÿ≥ŸäÿßŸÇ ÿßŸÑÿ∑ŸÑÿ® ŸÖÿπ ÿßŸÑÿØŸÖÿ¨ ŸàÿßŸÑÿ™ÿµŸÅŸäÿ© ÿπŸÑŸâ ÿßŸÑŸÜŸäÿ™ÿ±Ÿà ŸÅŸÇÿ∑
function collectCtxDedup(all){
  const map=new Map();
  for(const it of all){
    const j=it.json||{};
    const productName=j.productName??"";
    // ÿ™ÿ¨ÿßŸáŸÑ ÿ£Ÿä ÿπŸÜÿµÿ± ŸÑÿß Ÿäÿ≠ÿ™ŸàŸä ÿπŸÑŸâ "ŸÜŸäÿ™ÿ±Ÿà"
    if(!isNitroName(productName)) continue;

    const key=[j.productType||"", j.productCategory||"", norm(productName)].join("|");
    const q=Math.max(1,n(j.quantity,1));
    if(!map.has(key)){
      const parsed=parseProductFromName(productName);
      map.set(key,{
        order_id:j.order_id??null,
        order_ref:j.order_ref??null,
        phoneIntl:j.phoneIntl??null,
        productName:productName,
        // ÿ•ÿ∞ÿß ŸÉÿßŸÜÿ™ ÿ≠ŸÇŸàŸÑ ÿßŸÑŸÜŸàÿπ/ÿßŸÑŸÅÿ¶ÿ© ŸÅÿßÿ±ÿ∫ÿ©ÿå ŸÜÿπÿ™ŸÖÿØ ÿπŸÑŸâ ÿßŸÑÿßÿ≥ŸÖ
        productType:j.productType||parsed.productType||null,
        productCategory:j.productCategory||parsed.productCategory||null,
        quantity:q,
        isNitro:true
      });
    }else{
      const cur=map.get(key);
      if(q>cur.quantity) cur.quantity=q;
    }
  }

  const arr=[...map.values()];
  // ÿ•ÿ∞ÿß ŸÑŸÖ ÿ™Ÿàÿ¨ÿØ ŸÖŸÜÿ™ÿ¨ÿßÿ™ ŸÜŸäÿ™ÿ±Ÿà ŸÅŸä ÿßŸÑÿ∑ŸÑÿ® ŸÉŸÑŸáÿå ŸÑÿß ŸÜÿÆŸÖŸÜ ŸÖŸÜ ÿßŸÑÿ¥Ÿäÿ™ ŸàŸÑÿß ŸÜÿ±ÿ≥ŸÑ ÿ£Ÿä ÿ®ÿ±ŸàŸÖŸà
  return arr.length?arr:[];
}

const sheetItems=$items(SHEET_NODE_NAME)||[];
const rows=sheetItems.map(it=>it.json||{});
const inputItems=$input.all();
const ctxList=collectCtxDedup(inputItems);

// ŸÑÿß ÿ™ÿ≠ÿßŸàŸÑ ÿßŸÑÿßÿ≥ÿ™ŸÜÿ™ÿßÿ¨ ŸÖŸÜ ÿßŸÑÿ¥Ÿäÿ™ ÿ•ÿ∞ÿß ŸÑŸÖ ŸäŸÉŸÜ ÿßŸÑŸÖŸÜÿ™ÿ¨ ŸÜŸäÿ™ÿ±Ÿà
function inferFromRow(row){
  if(row[COLS.PROMO]&&isAvail(row[COLS.PROMO_STATUS])) return {productType:"promo",productCategory:null};
  const giftMonthOk=row[COLS.GIFT_M]&&isAvail(row[COLS.GIFT_M_STATUS]);
  const giftYearOk =row[COLS.GIFT_Y]&&isAvail(row[COLS.GIFT_Y_STATUS]);
  if(giftMonthOk||giftYearOk) return {productType:"gift",productCategory:giftMonthOk?"month":"year"};
  const cardMonthOk=row[COLS.CARD_M]&&n(row[COLS.CARD_M_REMAIN],0)>0;
  const cardYearOk =row[COLS.CARD_Y]&&n(row[COLS.CARD_Y_REMAIN],0)>0;
  if(cardMonthOk||cardYearOk) return {productType:"card",productCategory:cardMonthOk?"month":"year"};
  return {productType:"unknown",productCategory:null};
}

function processOneCtx(ctx){
  // ÿ•ÿ∞ÿß ŸÑÿ≥ÿ®ÿ® ŸÖÿß ÿØÿÆŸÑ ÿ≥ŸäÿßŸÇ ÿ∫Ÿäÿ± ŸÜŸäÿ™ÿ±Ÿàÿå ÿ™ÿ¨ÿßŸáŸÑŸá
  if(!ctx.isNitro) return {productType:"unknown",productCategory:null,productName:ctx.productName||"",itemsCollected:[],picked:0,quantity:ctx.quantity||1,found:false};

  let productType=ctx.productType||null;
  let productCategory=ctx.productCategory||null;
  const quantity=ctx.quantity;

  // ŸÑÿß ŸÜÿ≥ÿ™ŸÜÿ™ÿ¨ ŸÖŸÜ ÿßŸÑÿ¥Ÿäÿ™ ÿ•ŸÑÿß ÿ•ÿ∞ÿß ÿßŸÑŸÖŸÜÿ™ÿ¨ ŸÜŸäÿ™ÿ±Ÿà ŸàŸÖŸÅŸÇŸàÿØ ÿßŸÑŸÜŸàÿπ
  if((!productType||productType==="unknown")&&rows.length>0){
    const inf=inferFromRow(rows[0]); 
    productType=inf.productType; 
    productCategory=inf.productCategory;
  }

  let iterRows=rows;

  if(productType==="gift"){
    if(productCategory==="month"){
      iterRows=[...rows].sort((a,b)=>n(a[COLS.GIFT_M_LEFT],1e9)-n(b[COLS.GIFT_M_LEFT],1e9));
    }else if(productCategory==="year"){
      iterRows=[...rows].sort((a,b)=>n(a[COLS.GIFT_Y_LEFT],1e9)-n(b[COLS.GIFT_Y_LEFT],1e9));
    }
  } else if(productType==="card"){
    if(productCategory==="month"){
      iterRows=[...rows].sort((a,b)=>n(a[COLS.CARD_M_REMAIN],1e9)-n(b[COLS.CARD_M_REMAIN],1e9));
    }else if(productCategory==="year"){
      iterRows=[...rows].sort((a,b)=>n(a[COLS.CARD_Y_REMAIN],1e9)-n(b[COLS.CARD_Y_REMAIN],1e9));
    }
  }

  const itemsCollected=[];
  let picked=0;

  for(const row of iterRows){
    if(!productType||productType==="unknown") break;

    if(productType==="promo"){
      const link=row[COLS.PROMO];
      const nitroNum=row[COLS.PROMO_NUM];
      const ok=isAvail(row[COLS.PROMO_STATUS]);
      if(link&&ok){ 
        itemsCollected.push({
          value:String(link).trim(),
          nitroNumber:nitroNum?String(nitroNum).trim():null
        }); 
        picked++; 
        if(picked>=quantity) break; 
      }
    } else if(productType==="gift"){
      const useMonth=productCategory==="month";
      const link=row[useMonth?COLS.GIFT_M:COLS.GIFT_Y];
      const nitroNum=row[useMonth?COLS.GIFT_M_NUM:COLS.GIFT_Y_NUM];
      const status=row[useMonth?COLS.GIFT_M_STATUS:COLS.GIFT_Y_STATUS];
      const leftH=row[useMonth?COLS.GIFT_M_LEFT:COLS.GIFT_Y_LEFT];
      if(link&&isAvail(status)){
        itemsCollected.push({
          value:String(link).trim(),
          nitroNumber:nitroNum?String(nitroNum).trim():null,
          hours:n(leftH,0)
        });
        picked++; 
        if(picked>=quantity) break;
      }
    } else if(productType==="card"){
      const useMonth=productCategory==="month";
      const cardVal=row[useMonth?COLS.CARD_M:COLS.CARD_Y];
      const remain=n(row[useMonth?COLS.CARD_M_REMAIN:COLS.CARD_Y_REMAIN],0);
      if(cardVal&&remain>0){
        const canTake=Math.min(remain, quantity-picked);
        itemsCollected.push({
          value:String(cardVal).trim(),
          remain:remain,
          taken:canTake
        });
        picked += canTake;
        if(picked>=quantity) break;
      }
    }
  }

  const found=(productType==="promo"||productType==="gift"||productType==="card") ? itemsCollected.length>=1 : false;
  return {productType,productCategory,productName:ctx.productName||"",itemsCollected,picked,quantity,found};
}

// ÿ•ŸÜ ŸÑŸÖ ÿ™Ÿàÿ¨ÿØ ÿ£Ÿä ÿπŸÜÿßÿµÿ± ŸÜŸäÿ™ÿ±Ÿà ŸÅŸä ÿßŸÑÿ∑ŸÑÿ®ÿå ŸÜÿ±ÿ¨ÿπ ŸÜÿ™Ÿäÿ¨ÿ© ÿ¢ŸÖŸÜÿ© ÿ®ÿØŸàŸÜ ÿ£Ÿä ÿ•ÿ±ÿ≥ÿßŸÑ
if(ctxList.length===0){
  return [{
    json:{
      found: false,
      multiNitro: false,
      order_id: null,
      order_ref: null,
      phoneIntl: null,
      productName: "ŸÑÿß ÿ™Ÿàÿ¨ÿØ ŸÖŸÜÿ™ÿ¨ÿßÿ™ ŸÜŸäÿ™ÿ±Ÿà ŸÅŸä ÿßŸÑÿ∑ŸÑÿ®",
      productType: null,
      productCategory: null,
      quantity: 0,
      textToSend: "",
      pickedCount: 0,
    }
  }];
}

let blocks=[];
let totalPicked=0;
let anyFound=false;

for(const ctx of ctxList){
  const r=processOneCtx(ctx);
  anyFound = anyFound || r.found;
  totalPicked += r.picked;
  if(!r.found) continue;

  let titleBase = r.productName || (
    r.productType==="card" ? "ŸÜŸäÿ™ÿ±Ÿà ŸÇŸäŸÖŸÜŸÇ ÿ®ÿ∑ÿßŸÇÿ©" :
    r.productType==="gift" ? "ŸÜŸäÿ™ÿ±Ÿà ŸÇŸäŸÖŸÜŸÇ ŸÇŸäŸÅÿ™" :
    r.productType==="promo" ? "ŸÜŸäÿ™ÿ±Ÿà ŸÇŸäŸÖŸÜŸÇ ŸÇŸäŸÅÿ™ 3 ÿßÿ¥Ÿáÿ±" : "ŸÖŸÜÿ™ÿ¨"
  );

  if (!nameHasCategory(titleBase)) {
    if (r.productType==="card" || r.productType==="gift") {
      if (r.productCategory==="month") titleBase += " | ÿ¥Ÿáÿ±";
      else if (r.productCategory==="year") titleBase += " | ÿ≥ŸÜÿ©";
    } else if (r.productType==="promo") {
      titleBase += " | ÿ´ŸÑÿßÿ´ÿ© ÿßÿ¥Ÿáÿ±";
    }
  }

  // ÿ•ÿ®ÿ±ÿßÿ≤ ŸÖÿØÿ© ÿßŸÑÿ±ÿßÿ®ÿ∑ ÿ®ÿ¨ÿßŸÜÿ® ÿßŸÑÿ±ÿßÿ®ÿ∑ ŸÜŸÅÿ≥Ÿá (ŸÑŸÑŸÇŸäŸÅÿ™)
  const lines=[];
  for (const it of r.itemsCollected){
    let line = String(it.value).trim();
    if (r.productType === "gift" && it.hours !== undefined && it.hours !== null && !Number.isNaN(Number(it.hours))) {
      const h = n(it.hours, 0);
      if (h > 0) line += ` (ŸÖÿØÿ© ÿßŸÑÿ±ÿßÿ®ÿ∑ ${h} ÿ≥ÿßÿπÿ©)`;
    }
    lines.push(line);
  }

  blocks.push({title:titleBase, lines:lines, items:r.itemsCollected, ctx:r});
}

function labelFor(pt, pc){
  if(pt==="promo") return "ŸÜŸäÿ™ÿ±Ÿà 3 ÿßÿ¥Ÿáÿ±";
  if(pt==="card" && pc==="month") return "ŸÜŸäÿ™ÿ±Ÿà ÿ®ÿ∑ÿßŸÇÿ© ÿ¥Ÿáÿ±";
  if(pt==="card" && pc==="year")  return "ŸÜŸäÿ™ÿ±Ÿà ÿ®ÿ∑ÿßŸÇÿ© ÿ≥ŸÜÿ©";
  if(pt==="gift" && pc==="month") return "ŸÜŸäÿ™ÿ±Ÿà ŸÇŸäŸÅÿ™ ÿ¥Ÿáÿ±";
  if(pt==="gift" && pc==="year")  return "ŸÜŸäÿ™ÿ±Ÿà ŸÇŸäŸÅÿ™ ÿ≥ŸÜÿ©";
  return null;
}

// ŸÖŸÑÿµŸÇÿßÿ™ ŸÅŸÇÿ∑ ŸÑŸÑŸÖŸÜÿ™ÿ¨ÿßÿ™ ÿßŸÑŸÜŸäÿ™ÿ±Ÿà ÿßŸÑŸÖÿπÿßŸÑÿ¨ÿ©
const distinctLabels = new Set();
for (const b of blocks){
  const lbl = labelFor(b.ctx.productType, b.ctx.productCategory);
  if (lbl) distinctLabels.add(lbl);
}
const labelsArr = [...distinctLabels];
const multiNitro = labelsArr.length > 1;
let productNameForSwitch = labelsArr.length === 1 ? labelsArr[0] : (labelsArr.length > 1 ? labelsArr.join("\n") : "ÿ∫Ÿäÿ± ŸÖÿπÿ±ŸàŸÅ");

const totalRequested=ctxList.reduce((s,c)=>s+Math.max(1,n(c.quantity,1)),0);
let textToSend=blocks.map(b=>`${b.title}\n${b.lines.join("\n")}`).join("\n\n");
if(totalPicked<totalRequested && anyFound){
  const shortage="(ÿßŸÜÿ™Ÿáÿ™ ÿßŸÑŸÉŸÖŸäŸá ÿ≥ŸÜÿ±ÿ≥ŸÑŸÉŸÖ ÿßŸÑÿ±Ÿàÿßÿ®ÿ∑ ÿßŸÑŸÖÿ™ÿ®ŸÇŸäŸá ÿ®ÿ£ŸÇÿ±ÿ® ŸàŸÇÿ™)";
  textToSend=textToSend?`${textToSend}\n${shortage}`:shortage;
}

const firstBlock=blocks[0]||null;

// ÿßÿ≥ÿ™ÿÆÿ±ÿßÿ¨ ÿßŸÑÿ®ŸäÿßŸÜÿßÿ™ (ÿ•ŸÜ ŸàŸèÿ¨ÿØÿ™ ÿπŸÜÿßÿµÿ±)
let outputItems = [];
if(firstBlock && firstBlock.items.length > 0){
  outputItems = firstBlock.items.map(it => {
    const obj = { value: it.value };
    if(it.nitroNumber !== undefined) obj.nitroNumber = it.nitroNumber;
    if(it.hours !== undefined) obj.remainingHours = it.hours;
    if(it.remain !== undefined) {
      obj.remainingLimit = it.remain;
      obj.quantityTaken = it.taken || 0;
      obj.newRemaining = it.remain - (it.taken || 0);
    }
    return obj;
  });
}

// ÿ•ŸÜÿ¥ÿßÿ° outputs ŸÖŸÜŸÅÿµŸÑÿ© ŸÑŸÉŸÑ item
const outputs = outputItems.map(item => {
  const firstCtxProcessed = firstBlock ? firstBlock.ctx : {productType:null, productCategory:null};
  const output = {
    json: {
      found: anyFound,
      multiNitro: multiNitro,
      order_id: ctxList[0]?.order_id??null,
      order_ref: ctxList[0]?.order_ref??null,
      phoneIntl: ctxList[0]?.phoneIntl??null,
      productName: productNameForSwitch,
      productType: firstCtxProcessed.productType,
      productCategory: firstCtxProcessed.productCategory,
      quantity: totalRequested,
      textToSend: textToSend,
      pickedCount: totalPicked,
    }
  };

  if(firstCtxProcessed.productType === "card"){
    output.json.cardValue = item.value;
    output.json.remainingLimit = item.remainingLimit;
    output.json.quantityTaken = item.quantityTaken;
    output.json.newRemaining = item.newRemaining;
  }
  if(firstCtxProcessed.productType === "gift" || firstCtxProcessed.productType === "promo"){
    output.json.giftLink = item.value;
    output.json.nitroNumber = item.nitroNumber;
    if(item.remainingHours !== undefined){
      output.json.remainingHours = item.remainingHours;
    }
  }
  return output;
});

// ÿ•ÿ∞ÿß ŸÑÿß ÿ™Ÿàÿ¨ÿØ ÿπŸÜÿßÿµÿ± ŸÜŸäÿ™ÿ±Ÿà ÿµÿßŸÑÿ≠ÿ© ŸÑŸÑÿ•ÿ±ÿ≥ÿßŸÑ
if(outputs.length === 0){
  return [{
    json:{
      found: false,
      multiNitro: labelsArr.length>1,
      order_id: ctxList[0]?.order_id??null,
      order_ref: ctxList[0]?.order_ref??null,
      phoneIntl: ctxList[0]?.phoneIntl??null,
      productName: productNameForSwitch || "ŸÑÿß ÿ™Ÿàÿ¨ÿØ ÿπŸÜÿßÿµÿ± ŸÜŸäÿ™ÿ±Ÿà ÿµÿßŸÑÿ≠ÿ©",
      productType: null,
      productCategory: null,
      quantity: totalRequested,
      textToSend: "",
      pickedCount: 0,
    }
  }];
}

return outputs;

function normalize(str=""){return String(str).trim().toLowerCase();}
function digitsOnly(v){return String(v??"").replace(/[^\d]/g,"").trim();}
function makeFullPhone(cc,m){cc=digitsOnly(cc);m=digitsOnly(m);return cc&&m?cc+m:(m||cc||"");}
function findOrderNode(o){if(!o||typeof o!=="object")return null;const f=Object.prototype.hasOwnProperty.call(o,"reference_id")&&Array.isArray(o.items);if(f)return o;for(const k of Object.keys(o)){const v=o[k];if(v&&typeof v==="object"){const r=findOrderNode(v);if(r)return r;}}return null;}

function classifyProduct(name){
  const s=normalize(name);
  const isGift=/(ŸÇŸäŸÅÿ™|gift)\b/.test(s);
  const isPromo=/(ÿßŸÑÿ≠ÿ≥ÿßÿ®ÿßÿ™ ÿßŸÑÿ¨ÿØŸäÿØÿ©|ÿ™ÿ¨ÿ±ÿ®|ÿ™ÿ±ÿßŸäŸÑ|trial|promo|ÿ®ÿ±ŸàŸÖŸà)/.test(s);
  const isCard=/(ÿ®ÿ∑ÿßŸÇ|card)\b/.test(s)&&!isGift&&!isPromo;
  let productType="unknown";
  if(isPromo)productType="promo";
  else if(isGift)productType="gift";
  else if(isCard)productType="card";
  let productCategory=null;
  if(productType==="card"||productType==="gift"){
    if(s.includes("ÿ¥Ÿáÿ±")||s.includes("month"))productCategory="month";
    else if(s.includes("ÿ≥ŸÜÿ©")||s.includes("year"))productCategory="year";
  }
  return {productType,productCategory};
}

function get(o,p,d){try{return p.split(".").reduce((a,c)=>a==null?undefined:a[c],o)??d;}catch{return d;}}

const out=[];
let savedCtx=false;

for (const item of items){
  const root=item.json??item;
  const order=findOrderNode(root)||get(root,"body.data",root.data||{});
  let order_id=order?.id??get(root,"body.data.id",get(root,"data.id",null));
  let order_ref=order?.reference_id??get(root,"body.data.reference_id",get(root,"data.reference_id",null));
  const cc=get(order,"customer.mobile_code",get(root,"body.data.customer.mobile_code",""));
  const mob=get(order,"customer.mobile",get(root,"body.data.customer.mobile",""));
  const phoneIntl=makeFullPhone(cc,mob);
  const orderItems=Array.isArray(order?.items)?order.items:[];
  if(orderItems.length===0){
    const maybe=get(root,"items[0]")||root;
    const name=maybe?.name||maybe?.product?.name||"";
    const quantity=Number(maybe?.quantity??1)||1;
    if(name){
      const {productType,productCategory}=classifyProduct(name);
      if(!savedCtx){try{const g=getWorkflowStaticData('global');g.orderCtx={order_id,order_ref,phoneIntl,productName:name,productType,productCategory,quantity};savedCtx=true;}catch{}}
      out.push({json:{order_id,order_ref,phoneIntl,productName:name,quantity,productType,productCategory}});
      continue;
    }
    if(!savedCtx){try{const g=getWorkflowStaticData('global');g.orderCtx={order_id,order_ref,phoneIntl,productName:null,productType:null,productCategory:null,quantity:1};savedCtx=true;}catch{}}
    out.push({json:{order_id,order_ref,phoneIntl}});
    continue;
  }
  for(const line of orderItems){
    const name=line?.name||line?.product?.name||"";
    const quantity=Number(line?.quantity??1)||1;
    const {productType,productCategory}=classifyProduct(name);
    if(!savedCtx){try{const g=getWorkflowStaticData('global');g.orderCtx={order_id,order_ref,phoneIntl,productName:name,productType,productCategory,quantity};savedCtx=true;}catch{}}
    out.push({json:{order_id,order_ref,phoneIntl,productName:name,quantity,productType,productCategory}});
  }
}

return out;

// ŸäÿÆÿ™ÿßÿ± ÿ£ŸàŸÑ ŸÉŸàÿØ ÿ∫Ÿäÿ± ŸÅÿßÿ∂Ÿä ŸàŸäÿ±ÿ™ÿ® ŸÑŸÉ ŸÉŸÑ ÿßŸÑŸÇŸäŸÖ ŸÑŸÑÿßÿ±ÿ≥ÿßŸÑ ŸàÿßŸÑÿ™ÿ≠ÿØŸäÿ´
const item = $json;

// ÿÆÿ±Ÿäÿ∑ÿ© ÿπŸÖŸàÿØ ÿßŸÑŸÄPS ŸÖŸÜ ÿ≠ÿ±ŸÅ ÿßŸÑÿπŸÖŸàÿØ
const psMap = { E: 'PS5.1', F: 'PS5.2', G: 'PS4.1', H: 'PS4.2' };
const ps_col_header = psMap[item.slot_col];           // ŸÖÿ´ŸÑ PS4.2
if (!ps_col_header) {
  return { json: { ...item, error: 'invalid_slot_col' } };
}

// ÿ£ŸàŸÑ ŸÉŸàÿØ ŸÖÿ™ÿßÿ≠
const codes = Array.isArray(item.code_cells) ? item.code_cells : [];
const first = codes.find(c => c && c.value && String(c.value).trim() !== '');
if (!first) {
  // ÿ≠ÿ≥ÿ® ŸÉŸÑÿßŸÖŸÉ ÿØÿßÿ¶ŸÖÿßŸã ŸÅŸä ŸÉŸàÿØ ‚Äî ŸÑŸà ÿµÿßÿ± ÿßŸÑÿπŸÉÿ≥ ŸÜÿ±ÿ¨Ÿëÿπ ÿÆÿ∑ÿ£ Ÿàÿßÿ∂ÿ≠
  return { json: { ...item, error: 'no_code_found' } };
}

// ÿ±ŸÇŸÖ ÿßŸÑŸàÿßÿ™ÿ≥ÿßÿ® ÿ®ÿµŸäÿ∫ÿ© ÿØŸàŸÑŸäÿ© ÿ®ÿØŸàŸÜ +
const customer_phone = String(item.customer_phone || '').trim();

return {
  json: {
    ...item,
    customer_phone,                 // ŸÑÿßÿ±ÿ≥ÿßŸÑ ÿßŸÑŸàÿßÿ™ÿ≥ÿßÿ®             
    chosen_code: first.value,  // ÿßŸÑŸÉŸàÿØ ÿßŸÑŸÖÿÆÿ™ÿßÿ±
    code_col_header: first.header,   // ŸÖÿ´ŸÑ "Code 1"
    code_col_letter: first.col,      // I..R
