    ps_cell_a1: `${item.slot_col}${item.slot_row}`,      // ŸÖÿ´ÿßŸÑ H61
    code_cell_a1: `${first.col}${item.slot_row}`         // ŸÖÿ´ÿßŸÑ I61
  }
};

