// ===== helpers =====
const clean = (s) => (s ?? '')
  .toString()
  .replace(/\s+/g, ' ')
  .replace(/\u200f|\u200e/g, '')
  .trim();

const getPlatform = (name='') => {
  if (/ÿ≥ŸàŸÜŸä\s*5|ps\s*5/i.test(name)) return 'PS5';
  if (/ÿ≥ŸàŸÜŸä\s*4|ps\s*4/i.test(name)) return 'PS4';
  return null;
};

const getBaseTitle = (name='') => {
  let t = name;
  // ÿßÿ≠ÿ∞ŸÅ ÿßŸÑÿ¨ÿ≤ÿ° ÿßŸÑÿ£ÿÆŸäÿ±: "| ÿ≥ŸàŸÜŸä 4/5"
  t = t.replace(/\|\s*ÿ≥ŸàŸÜŸä\s*[45]\s*$/i, '');
  // ŸÑŸà ŸÅŸäŸá ÿ£ŸÉÿ´ÿ± ŸÖŸÜ | ÿÆÿ∞ ÿßŸÑÿ¨ÿ≤ÿ° ÿßŸÑÿ£ŸàŸÑ
  t = t.split('|')[0];
  return clean(t);
};

// ===== input normalization =====
// ŸÜÿØÿπŸÖ ŸÉŸÑ ÿßŸÑÿ£ÿ¥ŸÉÿßŸÑ: (body[0]) ÿ£Ÿà (body) ÿ£Ÿà ÿßŸÑÿ¨ÿ∞ÿ± ŸÜŸÅÿ≥Ÿá
const root =
  Array.isArray($json.body) ? $json.body[0]
  : ($json.body ?? $json);

const data = root?.data ?? {};

// ŸÖŸáŸÖ: ŸÜŸÅÿ±ŸëŸÇ ÿ®ŸäŸÜ ÿßŸÑÿßÿ´ŸÜŸäŸÜ
const orderId    = data.id ?? null;                 // ÿ™ÿ≥ÿ™ÿÆÿØŸÖŸá ŸÑÿ™ÿ∫ŸäŸäÿ± ÿ≠ÿßŸÑÿ© ÿßŸÑÿ∑ŸÑÿ®
const orderRef   = data.reference_id ?? orderId;    // ŸÑÿ±ŸÇŸÖ ÿßŸÑÿ∑ŸÑÿ® ÿßŸÑÿ≠ŸÇŸäŸÇŸä ŸÑŸÑÿ¥Ÿäÿ™

// ÿ±ŸÇŸÖ ÿßŸÑÿπŸÖŸäŸÑ ÿ®ÿµŸäÿ∫ÿ© ÿØŸàŸÑŸäÿ© (ÿ®ÿØŸàŸÜ + Ÿàÿ±ŸÖŸàÿ≤)
const cust = data.customer ?? {};
const mobileCode = String(cust.mobile_code ?? '');
const mobile = String(cust.mobile ?? '');
const digits = (mobileCode + mobile).replace(/[^\d]/g, '');
const customer_phone = digits.replace(/^0+/, ''); // ÿ¥ŸäŸÑ ÿ£ÿµŸÅÿßÿ± ÿßŸÑÿ®ÿØÿßŸäÿ© ŸÑŸà ŸÅŸäŸá

// ÿπŸÜÿßÿµÿ± ÿ≥ŸàŸÜŸä ŸÅŸÇÿ∑
const items = data.items ?? root.items ?? [];
const rawItems = items.filter(i => /ÿ≥ŸàŸÜŸä|ps\s*[45]/i.test(i?.name ?? ''));

const out = [];

for (const it of rawItems) {
  const qty = Math.max(1, Number(it?.quantity ?? 1));
  const productName = clean(it?.name ?? '');
  const platform = getPlatform(productName);
  const base_title = getBaseTitle(productName);

  for (let k = 0; k < qty; k++) {
    out.push({
      json: {
        order_id: orderId,        // Ÿäÿ®ŸÇŸâ ŸÉŸÖÿß ŸáŸà ŸÑÿßÿ≥ÿ™ÿÆÿØÿßŸÖŸá ŸÅŸä ÿßŸÑÿ™ÿ≠ÿØŸäÿ´
        order_ref: orderRef,      // Ÿáÿ∞ÿß ÿßŸÑŸÑŸä ÿ™ÿ≠ÿ∑Ÿá ŸÅŸä ÿßŸÑÿ¥Ÿäÿ™
        product_name: productName,
        base_title,
        platform,                 // "PS4" ÿ£Ÿà "PS5"
        customer_phone
      }
    });
  }
}

if (out.length === 0) {
  return [{ json: { playstation_items: 0, note: 'No PlayStation items found' } }];
}

return out;

// ---------- ÿ∂ÿ®ÿ∑ ÿ£ÿ≥ŸÖÿßÿ° ÿßŸÑÿ£ÿπŸÖÿØÿ© ----------
const PREV_CODE_NODE = "Code3";

// ÿπŸÜŸàÿßŸÜ ÿßŸÑŸÑÿπÿ®ÿ© ŸÇÿØ ŸäŸÉŸàŸÜ ŸÅŸä ÿ£ÿ≠ÿØ Ÿáÿ∞ŸäŸÜ ÿßŸÑÿπŸÖŸàÿØŸäŸÜ
const TITLE_COLS = ["ÿßŸÑÿπÿßÿ® ÿ≥ŸàŸÜŸä 4 & 5", "ÿßŸÑÿπÿßÿ® ÿ≥ŸàŸÜŸä 5"];

const COL_EMAIL = "ÿßŸäŸÖŸäŸÑ ÿßŸÑÿ≠ÿ≥ÿßÿ®";
const COL_PASS  = "ÿ®ÿßÿ≥Ÿàÿ±ÿØ ÿßŸÑÿ≠ÿ≥ÿßÿ®";
const CODE_HEADERS = [
  "Code 1","Code 2","Code 3","Code 4","Code 5",
  "Code 6","Code 7","Code 8","Code 9","Code 10"
];
const COL_LETTER = {
  "PS5.1":"E","PS5.2":"F","PS4.1":"G","PS4.2":"H",
  "Code 1":"I","Code 2":"J","Code 3":"K","Code 4":"L","Code 5":"M",
  "Code 6":"N","Code 7":"O","Code 8":"P","Code 9":"Q","Code 10":"R"
};

// ÿ™ŸÜÿ∏ŸäŸÅ ŸÇŸàŸä
function clean(s) {
  if (!s && s !== 0) return '';
  return String(s)
    .replace(/\s+/g, ' ')
    .replace(/\u200f|\u200e|\ufeff/g, '')
    .trim();
}
function isAccountId(a){ return /^[\w.\-]+$/.test(a || ""); }

// 1) ÿ≥ŸäÿßŸÇ ŸÖŸÜ ŸÜŸàÿØ Code
const srcItems = $items(PREV_CODE_NODE, 0);
if (!srcItems.length) return [{ json: { found:false, reason:"missing_prev_code_item" } }];
const ctx = srcItems[0].json;

const baseTitle      = clean(ctx.base_title || "");
const platform       = ctx.platform; // PS4 | PS5
const orderId        = ctx.order_id;
const orderRef       = ctx.order_ref ?? null;      // ÿ±ŸÇŸÖ ÿßŸÑÿ∑ŸÑÿ® ÿßŸÑÿ≠ŸÇŸäŸÇŸä
const productName    = clean(ctx.product_name || "");
const customer_phone = ctx.customer_phone || "";

// 2) ÿµŸÅŸàŸÅ ŸÖŸÜ ÿßŸÑŸÄ Merge
const rows = $input.all().map(i => i.json);
if (!rows.length) return [{ json: { found:false, reason:"no_rows" } }];

// 3) ÿßÿ®ÿ≠ÿ´ ÿπŸÜ ÿ≥ÿ∑ÿ± ÿπŸÜŸàÿßŸÜ ÿßŸÑŸÑÿπÿ®ÿ© ÿ®ÿ£Ÿä ÿπŸÖŸàÿØ ŸÖŸÜ TITLE_COLS (ÿ™ÿ∑ÿßÿ®ŸÇ ÿ¨ÿ≤ÿ¶Ÿä)
let titleIdx = -1;
let titleColUsed = null;

for (let i = 0; i < rows.length; i++) {
  for (const COL_TITLE of TITLE_COLS) {
    const cell = clean(rows[i][COL_TITLE]);
    if (!cell) continue;
    if (cell.includes(baseTitle) || baseTitle.includes(cell)) {
      titleIdx = i;
      titleColUsed = COL_TITLE;
      break;
    }
  }
  if (titleIdx >= 0) break;
}
if (titleIdx < 0) {
  return [{ json: { found:false, reason:"title_not_found", baseTitle } }];
}

// 4) ÿ≠ÿØŸàÿØ ÿßŸÑÿ®ŸÑŸàŸÉ ÿ™ÿ≠ÿ™ ÿßŸÑÿπŸÜŸàÿßŸÜ ÿ≠ÿ™Ÿâ ÿßŸÑÿπŸÜŸàÿßŸÜ ÿßŸÑÿ™ÿßŸÑŸä
let start = titleIdx + 1;
let end = rows.length - 1;
for (let i = start; i < rows.length; i++) {
  const a = clean(rows[i][titleColUsed]);
  if (a && !isAccountId(a)) { end = i - 1; break; }
}

// 5) ÿßÿÆÿ™Ÿéÿ± ÿ£ŸàŸÑ ÿµŸÅ ÿ®ÿ≠ŸÇŸÑ ŸÖŸÜÿµÿ© ŸÅÿßÿ∂Ÿä
const tryCols = platform === "PS5" ? ["PS5.1","PS5.2"] : ["PS4.1","PS4.2"];
let chosenRow = -1;
let chosenHeader = null;

for (let r = start; r <= end; r++) {
  const acc = clean(rows[r][titleColUsed]);
  if (!isAccountId(acc)) continue;
  for (const h of tryCols) {
    const v = clean(rows[r][h]);
    if (!v) { chosenRow = r; chosenHeader = h; break; }
  }
  if (chosenRow >= 0) break;
}
if (chosenRow < 0) {
  return [{ json: { found:false, reason:"no_empty_slot", title: baseTitle } }];
}

// 6) ÿ¨ŸáŸëÿ≤ ÿßŸÑŸÇŸäŸÖ
const picked = rows[chosenRow];
const accountLabel = clean(picked[titleColUsed]);
const email    = clean(picked[COL_EMAIL]);
const password = clean(picked[COL_PASS]);

const code_cells = CODE_HEADERS.map(h => ({
  header: h,
  col: COL_LETTER[h],
  value: clean(picked[h] || "")
}));

// ‚úÖ ÿ™ÿ≠ŸÇŸÇ ÿ£ŸÜ ŸÅŸäŸá ÿπŸÑŸâ ÿßŸÑÿ£ŸÇŸÑ ŸÉŸàÿØ Ÿàÿßÿ≠ÿØ ÿ∫Ÿäÿ± ŸÅÿßÿ∂Ÿä
const hasAnyCode = code_cells.some(c => c.value && String(c.value).trim() !== '');
if (!hasAnyCode) {
  return [{
    json: {
      found: false,
      reason: "no_code_available",
      title: baseTitle,
      sheet_name: titleColUsed
    }
  }];
}

const slot_row = picked.row_number;           // ŸÖŸÜ Get rows
const slot_col = COL_LETTER[chosenHeader];    // ÿ≠ÿ±ŸÅ ÿßŸÑÿπŸÖŸàÿØ E/F/G/H

return [{
  json: {
    found: true,
    sheet_name: titleColUsed,   // Ÿäÿ®ŸäŸÜ ŸÖŸÜ ÿ£Ÿä ÿ¥Ÿäÿ™ ÿ¨ÿ™
    order_id: orderId,
    order_ref: orderRef,
    customer_phone,
    product_name: productName,
    base_title: baseTitle,
    platform,
    account_label: accountLabel,
    slot_row,
    slot_col,
    email,
    password,
    code_cells
  }
}];

