const plan_label = plan_kind === 'month' ? 'ÿ¥Ÿáÿ±' : (plan_kind === 'day' ? 'ŸäŸàŸÖ' : '');

const COLS = (plan_kind === 'day')
  ? { status: 'ÿ≠ÿßŸÑÿ© ÿßŸÑÿ≠ÿ≥ÿßÿ® ŸäŸàŸÖ', email: 'ÿßŸäŸÖŸäŸÑ ÿ≠ÿ≥ÿßÿ®ÿßÿ™ ŸäŸàŸÖ', password: 'ÿ®ÿßÿ≥Ÿàÿ±ÿØ ÿ≠ÿ≥ÿßÿ®ÿßÿ™ ŸäŸàŸÖ', end: 'ŸÜŸáÿßŸäÿ© ÿßŸÑÿßÿ¥ÿ™ÿ±ÿßŸÉ ŸäŸàŸÖ' }
  : { status: 'ÿ≠ÿßŸÑÿ© ÿßŸÑÿ≠ÿ≥ÿßÿ® ÿ¥Ÿáÿ±', email: 'ÿßŸäŸÖŸäŸÑ ÿ≠ÿ≥ÿßÿ®ÿßÿ™ ÿ¥Ÿáÿ±', password: 'ÿ®ÿßÿ≥Ÿàÿ±ÿØ ÿ≠ÿ≥ÿßÿ®ÿßÿ™ ÿ¥Ÿáÿ±', end: 'ŸÜŸáÿßŸäÿ© ÿßŸÑÿßÿ¥ÿ™ÿ±ÿßŸÉ ÿ¥Ÿáÿ±' };

