function normalizeName(fullName) {
  if (!fullName) return { baseName: null, platform: 'other' };

  // ÿßŸÑÿßÿ≥ŸÖ ŸÇÿ®ŸÑ |
  const baseName = fullName.split('|')[0].trim();

  const name = fullName.toLowerCase();
  let platform = 'other';

  // --- 1) ŸÜŸÇÿßÿ∑ (Valorant / LoL / RP / VP / Points) ---
  if (
    name.includes('ŸÜŸÇÿßÿ∑') ||
    name.includes('points') ||
    name.includes('vp') ||
    name.includes('rp') ||
    name.includes('ÿ®ŸàŸäŸÜÿ™')
  ) {
    platform = 'points';

  // --- 2) ÿ≠ÿ≥ÿßÿ®ÿßÿ™ ÿπÿ¥Ÿàÿßÿ¶Ÿäÿ© Steam ---
  } else if (
    (name.includes('ÿ≠ÿ≥ÿßÿ®') || name.includes('account')) &&
    (name.includes('ÿ≥ÿ™ŸäŸÖ') || name.includes('steam')) &&
    (name.includes('ÿπÿ¥Ÿàÿßÿ¶Ÿä') || name.includes('random'))
  ) {
    platform = 'accounts';

  // --- 3) IPTV ---
  } else if (
    name.includes('ŸÜŸäŸàÿ±ÿ™ ÿ™Ÿä ŸÅŸä') ||
    name.includes('neurt tv') ||
    name.includes('iptv') ||
    name.includes('tv pro') ||
    (name.includes('ÿßÿ¥ÿ™ÿ±ÿßŸÉ') && name.includes('ÿ™Ÿä ŸÅŸä'))
  ) {
    platform = 'iptv';

  // --- 4) Steam (ÿ£ŸÑÿπÿßÿ® ÿ£ŸàŸÜŸÑÿßŸäŸÜ ŸÅŸÇÿ∑) ---
  } else if (
    (name.includes('ÿ≥ÿ™ŸäŸÖ') || name.includes('steam')) &&
    (
      name.includes('ÿßŸàŸÜŸÑÿßŸäŸÜ') ||
      name.includes('online') ||
      name.includes('multiplayer') ||
      name.includes('co-op') ||
      name.includes('coop')
    )
  ) {
    platform = 'steam';

  // --- 5) PS5 ---
  } else if (
    name.includes('ÿ≥ŸàŸÜŸä5') ||
    name.includes('ÿ≥ŸàŸÜŸä 5') ||
    name.includes('ps5')
  ) {
    platform = 'ps5';

  // --- 6) PS4 ---
  } else if (
    name.includes('ÿ≥ŸàŸÜŸä4') ||
    name.includes('ÿ≥ŸàŸÜŸä 4') ||
    name.includes('ps4')
  ) {
    platform = 'ps4';

  // --- 7) Xbox (ÿ£Ÿä ÿ∏ŸáŸàÿ± ŸÑŸÄ xbox / ÿßŸÉÿ≥ ÿ®ŸàŸÉÿ≥) ---
  } else if (
    /(\b(x\s*box|xbox)\b|ÿßŸÉÿ≥\s*ÿ®ŸàŸÉÿ≥|ÿ•ŸÉÿ≥\s*ÿ®ŸàŸÉÿ≥)/i.test(fullName)
  ) {
    platform = 'xbox';
  }

  return { baseName, platform };
}

