    const email = clean(rows[r]["ÿßŸäŸÖŸäŸÑ ÿßŸÑÿ≠ÿ≥ÿßÿ®"]);
    const pass  = clean(rows[r]["ÿ®ÿßÿ≥Ÿàÿ±ÿØ ÿßŸÑÿ≠ÿ≥ÿßÿ®"]);
