function formatToMDY(dateStr) {
  if (!dateStr) return null;

  // ŸÜŸÖÿ∑ yyyy-mm-dd ... (ŸÜÿ™ÿ¨ÿßŸáŸÑ ÿßŸÑŸàŸÇÿ™ ŸàÿßŸÑŸÖŸäŸÉÿ±Ÿàÿ´ŸàÿßŸÜŸä)
  const m = String(dateStr).match(/^(\d{4})-(\d{2})-(\d{2})/);
  if (!m) return null;

  const y = Number(m[1]);
  const mo = Number(m[2]); // 1..12
  const d = Number(m[3]);  // 1..31
  // ÿ®ÿØŸàŸÜ ÿ£ÿµŸÅÿßÿ± ÿ®ÿßÿØÿ¶ÿ©
  return `${mo}/${d}/${y}`;
}

